import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';

import './index.css';
import App from './App';
import CategorySection from './CategorySection'; // CategorySection 파일 경로에 맞게 수정
import reportWebVitals from './reportWebVitals';

// root 컨테이너에 App 컴포넌트를 렌더링합니다.
const rootContainer = document.getElementById('root');
if (rootContainer) {
  ReactDOM.render(
    <React.StrictMode>
      <BrowserRouter>
        <App />
      </BrowserRouter>
    </React.StrictMode>,
    rootContainer
  );
} else {
  console.error('Container element with id "root" not found.');
}


// category 컨테이너에 CategorySection 컴포넌트를 렌더링합니다.
const categoryContainer = document.getElementById('category');
if (categoryContainer) {
  ReactDOM.render(
    <React.StrictMode>
      <CategorySection />
    </React.StrictMode>,
    categoryContainer
  );
} else {
  console.error('Container element with id "category" not found.');
}

reportWebVitals();
